import "bootstrap/dist/css/bootstrap.min.css";
import '../public/assets/plugins/animation/css/animate.min.css'
import '../public/assets/css/style.css'
import '../public/assets/fonts/datta/datta-icon.css';
import '../public/assets/fonts/feather/css/feather.css';
import '../public/assets/fonts/flag/css/flag-icon.min.css';
import '../public/assets/fonts/fontawesome/css/fontawesome-all.min.css'
import '../public/assets/fonts/material/css/materialdesignicons.min.css';
import '../public/assets/fonts/simple-line-icons/css/simple-line-icons.css';
import '../public/assets/fonts/themify/themify.css';
import '../styles/teacher-dashboard.css'

function MyApp({ Component, pageProps }) {
  return <Component {...pageProps} />
}

export default MyApp
